import React, { useState } from "react";
import JoinForm from "./components/JoinForm";
import LoginForm from "./components/LoginForm";

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<LoginForm />} />
        <Route path="/join" element={<JoinForm />} />
      </Routes>
    </div>
  );
}

export default App;
